oxy_webhelp_navlinks = {"rubrik_cc_es_on_saas-d23139e41657":{"topics":[{"title":"Rubrik Cloud Cluster ES for Azure","shortdesc":"<p class=\"shortdesc\">You can use Rubrik Cloud Cluster Elastic Storage for Azure to protect applications         and data within a Microsoft Azure virtual network.<\/p>","href":"saas\/azure_cc_es_rsc.html","attributes":{"data-id":"azure_cc_es_rsc"},"menu":{"hasChildren":false},"tocID":"azure_cc_es_rsc-d23139e41671","next":"azure_cc_es_rsc-d23139e41671"},{"title":"Rubrik Cloud Cluster ES for AWS","shortdesc":"<p class=\"shortdesc\">A Rubrik Cloud Cluster Elastic Storage protects applications and data by running         Rubrik CDM software on Amazon EC2 instances within a virtual private cloud.<\/p>","href":"saas\/aws_cc_es_rsc.html","attributes":{"data-id":"aws_cc_es_rsc"},"menu":{"hasChildren":false},"tocID":"aws_cc_es_rsc-d23139e41857","next":"aws_cc_es_rsc-d23139e41857"},{"title":"Rubrik Cloud Cluster recoverability","shortdesc":"<p class=\"shortdesc\">To restore your data, you can recover a Rubrik Cloud Cluster Elastic Storage that has         immutability enabled. You can do this only when the cluster nodes cannot be         recovered.<\/p>","href":"saas\/cces_recoverability.html","attributes":{"data-id":"cces_recoverability"},"menu":{"hasChildren":false},"tocID":"cces_recoverability-d23139e41957","next":"cces_recoverability-d23139e41957"},{"title":"Adding a node to Cloud Cluster ES","shortdesc":"<p class=\"shortdesc\">Add a node to a Cloud Cluster ES to increase capacity and improve         performance.<\/p>","href":"saas\/adding_node_cces.html","attributes":{"data-id":"adding_a_node_to_cc_es"},"menu":{"hasChildren":false},"tocID":"adding_a_node_to_cc_es-d23139e41990","topics":[]},{"title":"Adding a pre-deployed node to Rubrik Cloud Cluster ES","shortdesc":"<p class=\"shortdesc\">Add a node that you have manually deployed in AWS or Azure to the Rubrik Cloud         Cluster ES in <span class=\"ph\">RSC<\/span>. Additional nodes increase capacity and improve         performance.<\/p>","href":"saas\/adding_node_predeployed_cces.html","attributes":{"data-id":"adding_node_predeployed_cces"},"menu":{"hasChildren":false},"tocID":"adding_node_predeployed_cces-d23139e42001","topics":[]},{"title":"Node removal in <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">If you no longer require a node in a Rubrik cluster, a supported third-party hardware         cluster, or a Rubrik Cloud Cluster, you can remove the node by using <span class=\"ph\">RSC<\/span>.         To remove a node, you must meet the requirements for node removal.<\/p>","href":"saas\/node_removal_rsc_2.html","attributes":{"data-id":"node_removal_rsc"},"menu":{"hasChildren":false},"tocID":"node_removal_rsc-d23139e42015","next":"node_removal_rsc-d23139e42015"},{"title":"Extra dense node migration for CCES clusters","shortdesc":"<p class=\"shortdesc\">Extra dense nodes offer greater storage and performance, without a loss of storage         capacity. Using extra dense nodes, organizations can reduce node counts by half during         migration. Customization options are available through the GraphQL API.<\/p>","href":"saas\/extra_dense_migration_cces_clusters.html","attributes":{"data-id":"extra_dense_migration_cces_clusters"},"menu":{"hasChildren":false},"tocID":"extra_dense_migration_cces_clusters-d23139e42042","topics":[]}]}};